INSERT INTO `movies` (`movie_id`, `title`, `overview`, `release_date`, `vote_average`, `backdrop_path`, `poster_path`, `language`, `adult`) VALUES
(11,	'Star Wars',	'Princess Leia is captured and held hostage by the evil Imperial forces in their effort to take over the galactic Empire. Venturesome Luke Skywalker and dashing captain Han Solo team together with the loveable robot duo R2-D2 and C-3PO to rescue the beautiful princess and restore peace and justice in the Empire.',	'1977-05-25',	8.203,	'/4qCqAdHcNKeAHcK8tJ8wNJZa9cx.jpg',	'/6FfCtAuVAW8XJjZ7eWeLibRLWTw.jpg',	'en',	0),
(15,	'Citizen Kane',	'Newspaper magnate Charles Foster Kane is taken from his mother as a boy and made the ward of a rich industrialist. As a result, every well-meaning, tyrannical or self-destructive move he makes for the rest of his life appears in some way to be a reaction to that deeply wounding event.',	'1941-04-17',	8.008,	'/ruF3Lmd4A8MHbnEBE6lxPMbsHGL.jpg',	'/sav0jxhqiH0bPr2vZFU0Kjt2nZL.jpg',	'en',	0),
(62,	'2001: A Space Odyssey',	'Humanity finds a mysterious object buried beneath the lunar surface and sets off to find its origins with the help of HAL 9000, the world s most advanced super computer.',	'1968-04-02',	8.078,	'/w5IDXtifKntw0ajv2co7jFlTQDM.jpg',	'/ve72VxNqjGM69Uky4WTo2bK6rfq.jpg',	'en',	0),
(103,	'Taxi Driver',	'A mentally unstable Vietnam War veteran works as a night-time taxi driver in New York City where the perceived decadence and sleaze feed his urge for violent action.',	'1976-02-09',	8.15,	'/6aoyUbvu0419XLKLIMoH0TkEicH.jpg',	'/ekstpH614fwDX8DUln1a2Opz0N8.jpg',	'en',	0),
(106,	'Predator',	'A team of elite commandos on a secret mission in a Central American jungle come to find themselves hunted by an extraterrestrial warrior.',	'1987-06-12',	7.527,	'/YL3GPOiDcNraIJOVDCZsoOBoDy.jpg',	'/k3mW4qfJo6SKqe6laRyNGnbB9n5.jpg',	'en',	0),
(141,	'Donnie Darko',	'After narrowly escaping a bizarre accident, a troubled teenager is plagued by visions of a large bunny rabbit that manipulates him to commit a series of crimes.',	'2001-01-19',	7.779,	'/msCHK5Kh1YbdZ0zPJ2nzPUhhSN9.jpg',	'/j5t4GWyBunfW24WMrLACj98THGW.jpg',	'en',	0),
(218,	'The Terminator',	'In the post-apocalyptic future, reigning tyrannical supercomputers teleport a cyborg assassin known as the  Terminator  back to 1984 to kill Sarah Connor, whose unborn son is destined to lead insurgents against 21st century mechanical hegemony. Meanwhile, the human-resistance movement dispatches a lone warrior to safeguard Sarah. Can he stop the virtually indestructible killing machine?',	'1984-10-26',	7.665,	'/6dpnthrofbqWmvapUyvqCrkdHG.jpg',	'/qvktm0BHcnmDpul4Hz01GIazWPr.jpg',	'en',	0),
(348,	'Alien',	'During its return to the earth, commercial spaceship Nostromo intercepts a distress signal from a distant planet. When a three-member team of the crew discovers a chamber containing thousands of eggs on the planet, a creature inside one of the eggs attacks an explorer. The entire crew is unaware of the impending nightmare set to descend upon them when the alien parasite planted inside its unfortunate host is birthed.',	'1979-05-25',	8.153,	'/AmR3JG1VQVxU8TfAvljUhfSFUOx.jpg',	'/vfrQk5IPloGg1v9Rzbh2Eg3VGyM.jpg',	'en',	0),
(603,	'The Matrix',	'Set in the 22nd century, The Matrix tells the story of a computer hacker who joins a group of underground insurgents fighting the vast and powerful computers who now rule the earth.',	'1999-03-31',	8.216,	'/icmmSD4vTTDKOq2vvdulafOGw93.jpg',	'/f89U3ADr1oiB1s9GkdPOEpXUk5H.jpg',	'en',	0),
(680,	'Pulp Fiction',	'A burger-loving hit man, his philosophical partner, a drug-addled gangster s moll and a washed-up boxer converge in this sprawling, comedic crime caper. Their adventures unfurl in three stories that ingeniously trip back and forth in time.',	'1994-09-10',	8.489,	'/suaEOtk1N1sgg2MTM7oZd2cfVp3.jpg',	'/d5iIlFn5s0ImszYzBPb8JPIfbXD.jpg',	'en',	0),
(794,	'The Omen',	'Immediately after their miscarriage, the US diplomat Robert Thorn adopts the newborn Damien without the knowledge of his wife. Yet what he doesnt know is that their new son is the son of the devil.',	'1976-06-25',	7.398,	'/3RkYyseo8OduQpdndyPPCMiJfuC.jpg',	'/p0LcWxOIoBx0MEZMn8tFcrvDXR1.jpg',	'en',	0),
(1366,	'Rocky',	'An uneducated collector for a Philadelphia loan shark is given a once-in-a-lifetime opportunity to fight against the world heavyweight boxing champion.',	'1976-11-20',	7.787,	'/kK9v1wclQxug6ZUJucD4DTaHgVF.jpg',	'/cqxg1CihGR5ge0i1wYXr4Rdeppu.jpg',	'en',	0),
(1700,	'Misery',	'After stalking and saving the life of her favorite fiction author in a car accident, his  manic obsessor holds him captive in her remote Colorado home then forces him to write back to life the popular literary character he killed off.',	'1990-11-30',	7.755,	'/cgo3OmF84touDrrLkQ1DQ3MRFyO.jpg',	'/23Y65uWaVMpqfbZTN3CT0aei4D5.jpg',	'en',	0),
(1701,	'Con Air',	'Newly-paroled former US Army ranger Cameron Poe is headed back to his wife, but must fly home aboard a prison transport flight dubbed  Jailbird  taking the worst of the worst prisoners, a group described as pure predators, to a new super-prison. Poe faces impossible odds when the transport plane is skyjacked mid-flight by the most vicious criminals in the country led by the mastermind  genius serial killer Cyrus  The Virus  Grissom, and backed by black militant Diamond Dog and psychopath Bi',	'1997-06-05',	6.749,	'/1fldJZ43ftMj3gKbhf8idjI7fWO.jpg',	'/kOKjgrEzGOP92rVQ6srA9jtp60l.jpg',	'en',	0),
(1924,	'Superman',	'Mild-mannered Clark Kent works as a reporter at the Daily Planet alongside his crush, Lois Lane. Clark must summon his superhero alter-ego when the nefarious Lex Luthor launches a plan to take over the world.',	'1978-12-14',	7.135,	'/v6MVBFnQOscITvmAy5N5ras2JKZ.jpg',	'/d7px1FQxW4tngdACVRsCSaZq0Xl.jpg',	'en',	0),
(2666,	'Dark City',	'A man struggles with memories of his past, including a wife he cannot remember, in a nightmarish world with no sun and run by beings with telekinetic powers who seek the souls of humans.',	'1998-02-27',	7.321,	'/bmAzESah8IUNRQX5MqeyUrhE5Pr.jpg',	'/AdBe2ow8hdlT2aLBYuUjs0Xkqkw.jpg',	'en',	0),
(5548,	'RoboCop',	'In a violent, near-apocalyptic Detroit, evil corporation Omni Consumer Products wins a contract from the city government to privatize the police force. To test their crime-eradicating cyborgs, the company leads street cop Alex Murphy into an armed confrontation with crime lord Boddicker so they can use his body to support their untested RoboCop prototype. But when RoboCop learns of the company s nefarious plans, he turns on his masters.',	'1987-07-17',	7.318,	'/pRSTtNlcADoQkfeBGtFQNE1FDpb.jpg',	'/cngw1BffJyZgze2PCKsZmJPSEZ6.jpg',	'en',	0),
(7451,	'xXx',	'Xander Cage is your standard adrenaline junkie with no fear and a lousy attitude. When the US Government  recruits  him to go on a mission, he s not exactly thrilled. His mission: to gather information on an organization that may just be planning the destruction of the world, led by the nihilistic Yorgi.',	'2002-08-09',	5.933,	'/qwK9soQmmJ7kRdjLZVXblw3g7AQ.jpg',	'/xeEw3eLeSFmJgXZzmF2Efww0q3s.jpg',	'en',	0),
(9482,	'Judge Dredd',	'In a dystopian future, Dredd, the most famous judge (a cop with instant field judiciary powers) is convicted for a crime he did not commit while his murderous counterpart escapes.',	'1995-06-30',	5.786,	'/baJHUXBcoaHnMf2sjwegbuhIjEV.jpg',	'/cfSnKn8NDU3m8UxihjVcYprA0Aq.jpg',	'en',	0),
(10138,	'Iron Man 2',	'With the world now aware of his dual life as the armored superhero Iron Man, billionaire inventor Tony Stark faces pressure from the government, the press and the public to share his technology with the military. Unwilling to let go of his invention, Stark, with Pepper Potts and James  Rhodey  Rhodes at his side, must forge new alliances  and confront powerful enemies.',	'2010-04-28',	6.841,	'/7lmBufEG7P7Y1HClYK3gCxYrkgS.jpg',	'/6WBeq4fCfn7AN0o21W9qNcRF2l9.jpg',	'en',	0),
(16320,	'Serenity',	'When the renegade crew of Serenity agrees to hide a fugitive on their ship, they find themselves in an action-packed battle between the relentless military might of a totalitarian regime who will destroy anything  or anyone  to get the girl back and the bloodthirsty creatures who roam the uncharted areas of space. But... the greatest danger of all may be on their ship.',	'2005-09-25',	7.4,	'/csGprKcRxt7SDpsrKiwxpgLdEsx.jpg',	'/4sqUOaPFoP2W81mq1UYqZqf5WzA.jpg',	'en',	0),
(27205,	'Inception',	'Cobb, a skilled thief who commits corporate espionage by infiltrating the subconscious of his targets is offered a chance to regain his old life as payment for a task considered to be impossible:  inception , the implantation of another person s idea into a target s subconscious.',	'2010-07-15',	8.4,	'/28kKbSUvUz6P5RE1AuMJMO7IMfK.jpg',	'/oYuLEt3zVCKq57qu2F8dT7NIa6f.jpg',	'en',	0),
(43074,	'Ghostbusters',	'Following a ghost invasion of Manhattan, paranormal enthusiasts Erin Gilbert and Abby Yates, nuclear engineer Jillian Holtzmann, and subway worker Patty Tolan band together to stop the otherworldly threat.',	'2016-07-14',	5.358,	'/3RWsSQlqzRjsuqSRmoyggy74UA7.jpg',	'/wJmWliwXIgZOCCVOcGRBhce7xPS.jpg',	'en',	0),
(49047,	'Gravity',	'Dr. Ryan Stone, a brilliant medical engineer on her first Shuttle mission, with veteran astronaut Matt Kowalsky in command of his last flight before retiring. But on a seemingly routine spacewalk, disaster strikes. The Shuttle is destroyed, leaving Stone and Kowalsky completely alone-tethered to nothing but each other and spiraling out into the blackness of space. The deafening silence tells them they have lost any link to Earth and any chance for rescue. As fear turns to panic, every gulp of ai',	'2013-10-03',	7.165,	'/a2n6bKD7qhCPCAEALgsAhWOAQcc.jpg',	'/kZ2nZw8D681aphje8NJi8EfbL1U.jpg',	'en',	0),
(68730,	'Silence',	'Two Jesuit priests travel to seventeenth century Japan which has, under the Tokugawa shogunate, banned Catholicism and almost all foreign contact.',	'2016-12-22',	7.125,	'/2tE0A6WjLowwQOUY8se1Xlf3O6U.jpg',	'/x5T0cQDYws0xRBVG4Q3wpcrcmax.jpg',	'en',	0),
(76341,	'Mad Max: Fury Road',	'An apocalyptic story set in the furthest reaches of our planet, in a stark desert landscape where humanity is broken, and most everyone is crazed fighting for the necessities of life. Within this world exist two rebels on the run who just might be able to restore order.',	'2015-05-13',	7.596,	'/gqrnQA6Xppdl8vIb2eJc58VC1tW.jpg',	'/hA2ple9q4qnwxp3hKVNhroipsir.jpg',	'en',	0),
(119450,	'Dawn of the Planet of the Apes',	'A group of scientists in San Francisco struggle to stay alive in the aftermath of a plague that is wiping out humanity, while Caesar tries to maintain dominance over his community of intelligent apes.',	'2014-07-08',	7.321,	'/4TFCA5Lm5miseV3Wy02yxurEQL9.jpg',	'/kScdQEwS9jPEdnO23XjGAtaoRcT.jpg',	'en',	0),
(126889,	'Alien: Covenant',	'The crew of the colony ship Covenant, bound for a remote planet on the far side of the galaxy, discovers what they think is an uncharted paradise but is actually a dark, dangerous world.',	'2017-05-09',	6.11,	'/2qluV8y79LnBBHaMpwewCjQ1Htk.jpg',	'/zecMELPbU5YMQpC81Z8ImaaXuf9.jpg',	'en',	0),
(141052,	'Justice League',	'Fuelled by his restored faith in humanity and inspired by Superman s selfless act, Bruce Wayne and Diana Prince assemble a team of metahumans consisting of Barry Allen, Arthur Curry and Victor Stone to face the catastrophic threat of Steppenwolf and the Parademons who are on the hunt for three Mother Boxes on Earth.',	'2017-11-15',	6.087,	'/2nyaeISu2xIxIgZYNpX4UayY8PN.jpg',	'/eifGNCSDuxJeS1loAXil5bIGgvC.jpg',	'en',	0),
(157336,	'Interstellar',	'The adventures of a group of explorers who make use of a newly discovered wormhole to surpass the limitations on human space travel and conquer the vast distances involved in an interstellar voyage.',	'2014-11-05',	8.434,	'/xJHokMbljvjADYdit5fK5VQsXEG.jpg',	'/gEU2QniE6E77NI6lCU6MxlNBvIx.jpg',	'en',	0),
(206647,	'Spectre',	'A cryptic message from Bonds past sends him on a trail to uncover a sinister organization. While M battles political forces to keep the secret service alive, Bond peels back the layers of deceit to reveal the terrible truth behind SPECTRE.',	'2015-10-26',	6.5,	'/8lBViysvNJBPkl6zG1LVAaW3qhj.jpg',	'/zj8ongFhtWNsVlfjOGo8pSr7PQg.jpg',	'en',	0),
(263115,	'Logan',	'In the near future, a weary Logan cares for an ailing Professor X in a hideout on the Mexican border. But Logan s attempts to hide from the world and his legacy are upended when a young mutant arrives, pursued by dark forces.',	'2017-02-28',	7.817,	'/9X7YweCJw3q8Mcf6GadxReFEksM.jpg',	'/fnbjcRDYn6YviCcePDnGdyAkYsB.jpg',	'en',	0),
(284052,	'Doctor Strange',	'After his career is destroyed, a brilliant but arrogant surgeon gets a new lease on life when a sorcerer takes him under her wing and trains him to defend the world against evil.',	'2016-10-25',	7.421,	'/3zvZ699gMW2RhWc0GisIukzq0Ls.jpg',	'/7WfK17BXE6szXlm4WOxfswgbdsL.jpg',	'en',	0),
(284053,	'Thor: Ragnarok',	'Thor is imprisoned on the other side of the universe and finds himself in a race against time to get back to Asgard to stop Ragnarok, the destruction of his home-world and the end of Asgardian civilization, at the hands of a powerful new threat, the ruthless Hela.',	'2017-10-02',	7.592,	'/kaIfm5ryEOwYg8mLbq8HkPuM1Fo.jpg',	'/rzRwTcFvttcN1ZpX2xv4j3tSdJu.jpg',	'en',	0),
(284054,	'Black Panther',	'King T Challa returns home to the reclusive, technologically advanced African nation of Wakanda to serve as his country s new leader. However, T Challa soon finds that he is challenged for the throne by factions within his own country as well as without. Using powers reserved to Wakandan kings, T Challa assumes the Black Panther mantle to join with ex-girlfriend Nakia, the queen-mother, his princess-kid sister, members of the Dora Milaje (the Wakandan  special forces ) and an American secret age',	'2018-02-13',	7.384,	'/b6ZJZHUdMEFECvGiDpJjlfUWela.jpg',	'/uxzzxijgPIY7slzFvMotPv8wjKA.jpg',	'en',	0),
(293660,	'Deadpool',	'The origin story of former Special Forces operative turned mercenary Wade Wilson, who, after being subjected to a rogue experiment that leaves him with accelerated healing powers, adopts the alter ego Deadpool. Armed with his new abilities and a dark, twisted sense of humor, Deadpool hunts down the man who nearly destroyed his life.',	'2016-02-09',	7.612,	'/en971MEXui9diirXlogOrPKmsEn.jpg',	'/fSRb7vyIP8rQpL0I47P3qUsEKX3.jpg',	'en',	0),
