(882059,	'Boy Kills World',	'When his family is murdered, a deaf-mute named Boy escapes to the jungle and is trained by a mysterious shaman to repress his childish imagination and become an instrument of death.',	'2024-04-24',	6.78,	'/1m1rXopfNDVL3UMiv6kriYaJ3yE.jpg',	'/25JskXmchcYwj3jHRmcPm738MpB.jpg',	'en',	0),
(929590,	'Civil War',	'In the near future, a group of war journalists attempt to survive while reporting the truth as the United States stands on the brink of civil war.',	'2024-04-10',	7.2,	'/z121dSTR7PY9KxKuvwiIFSYW8cf.jpg',	'/sh7Rg8Er3tFcN9BpKIPOMvALgZd.jpg',	'en',	0),
(937287,	'Challengers',	'Tennis player turned coach Tashi has taken her husband, Art, and transformed him into a world-famous Grand Slam champion. To jolt him out of his recent losing streak, she signs him up for a  Challenger  event  close to the lowest level of pro tournament  where he finds himself standing across the net from his former best friend and Tashi s former boyfriend.',	'2024-04-18',	7.273,	'/4CcUgdiGe83MeqJW1NyJVmZqRrF.jpg',	'/H6vke7zGiuLsz4v4RPeReb9rsv.jpg',	'en',	0),
(940551,	'Migration',	'After a migrating duck family alights on their pond with thrilling tales of far-flung places, the Mallard family embarks on a family road trip, from New England, to New York City, to tropical Jamaica.',	'2023-12-06',	7.459,	'/2KGxQFV9Wp1MshPBf8BuqWUgVAz.jpg',	'/ldfCF9RhR40mppkzmftxapaHeTo.jpg',	'en',	0),
(940721,	'Godzilla Minus One',	'Postwar Japan is at its lowest point when a new crisis emerges in the form of a giant monster, baptized in the horrific power of the atomic bomb.',	'2023-11-03',	7.651,	'/fY3lD0jM5AoHJMunjGWqJ0hRteI.jpg',	'/hkxxMIGaiCTmrEArK7J56JTKUlB.jpg',	'ja',	0),
(967847,	'Ghostbusters: Frozen Empire',	'When the discovery of an ancient artifact unleashes an evil force, Ghostbusters new and old must join forces to protect their home and save the world from a second Ice Age.',	'2024-03-20',	6.658,	'/wODqakS0jinTUECNS6n4VomQbew.jpg',	'/e1J2oNzSBdou01sUvriVuoYp0pJ.jpg',	'en',	0),
(996154,	'Black Lotus',	'An ex-special forces operative wages a one man war through the streets of Amsterdam to rescue his friend s daughter from the local crime syndicate.',	'2023-04-12',	6.495,	'/tdkCqOQ87ns39bWtzjJYsGTloH9.jpg',	'/y3AeW200hqGLxoPyHMDHpzudylz.jpg',	'en',	0),
(1011985,	'Kung Fu Panda 4',	'Po is gearing up to become the spiritual leader of his Valley of Peace, but also needs someone to take his place as Dragon Warrior. As such, he will train a new kung fu practitioner for the spot and will encounter a villain called the Chameleon who conjures villains from the past.',	'2024-03-02',	7.1,	'/kYgQzzjNis5jJalYtIHgrom0gOx.jpg',	'/kDp1vUBnMpe8ak4rjgl3cLELqjU.jpg',	'en',	0),
(1022789,	'Inside Out 2',	'Teenager Riley s mind headquarters is undergoing a sudden demolition to make room for something entirely unexpected: new Emotions! Joy, Sadness, Anger, Fear and Disgust, whove long been running a successful operation by all accounts, arent sure how to feel when Anxiety shows up. And it looks like shes not alone.',	'2024-06-06',	0,	'/yVgW3PW5Xxk4PHCDzd9f31Aejg5.jpg',	'/gMB8vgHu2lcyzv1fyptD6drHmJd.jpg',	'en',	0),
(1041613,	'Immaculate',	'An American nun embarks on a new journey when she joins a remote convent in the Italian countryside. However, her warm welcome quickly turns into a living nightmare when she discovers her new home harbours a sinister secret and unspeakable horrors.',	'2024-03-20',	6.223,	'/5Eip60UDiPLASyKjmHPMruggTc4.jpg',	'/fdZpvODTX5wwkD0ikZNaClE4AoW.jpg',	'en',	0),
(1087388,	'Sting',	'After raising an unnervingly talented spider in secret, 12-year-old Charlotte must face the truth about her pet and fight for her family s survival.',	'2024-04-12',	6.328,	'/k37Ccgu05Am1xxgN5GaW0HX9Kkl.jpg',	'/zuSAZIG1PSrxFwPeAlGtg9LTwxo.jpg',	'en',	0),
(1093995,	'Chief of Station',	'After learning that the death of his wife was not an accident, a former CIA Station Chief is forced back into the espionage underworld, teaming up with an adversary to unravel a conspiracy that challenges everything he thought he knew.',	'2024-05-02',	5.338,	'/rmNlWyez5cniGtXkgixG1ezdqVk.jpg',	'/uuA01PTtPombRPvL9dvsBqOBJWm.jpg',	'en',	0),
(1094844,	'Ape vs Mecha Ape',	'Recognizing the destructive power of its captive giant Ape, the military makes its own battle-ready A.I., Mecha Ape. But its first practical test goes horribly wrong, leaving the military no choice but to release the imprisoned giant ape to stop the colossal robot before it destroys downtown Chicago.',	'2023-03-24',	5.649,	'/jnE1GA7cGEfv5DJBoU2t4bZHaP4.jpg',	'/dJaIw8OgACelojyV6YuVsOhtTLO.jpg',	'en',	0),
(1096197,	'No Way Up',	'Characters from different backgrounds are thrown together when the plane they re travelling on crashes into the Pacific Ocean. A nightmare fight for survival ensues with the air supply running out and dangers creeping in from all sides.',	'2024-01-18',	6.4,	'/4woSOUD0equAYzvwhWBHIJDCM88.jpg',	'/hu40Uxp9WtpL34jv3zyWLb5zEVY.jpg',	'en',	0),
(1111873,	'Abigail',	'A group of criminals kidnaps a teenage ballet dancer, the daughter of a notorious gang leader, in order to obtain a ransom of $50 million, but over time, they discover that she is not just an ordinary girl. After the kidnappers begin to diminish, one by one, they discover, to their increasing horror, that they are locked inside with an unusual girl.',	'2024-04-18',	6.837,	'/ySgY4jBvZ6qchrxKnBg4M8tZp8V.jpg',	'/5gKKSoD3iezjoL7YqZONjmyAiRA.jpg',	'en',	0),
(1111966,	'Mercy',	'An ex-military doctor finds herself in a deadly battle for survival when the Irish mafia seize control of the hospital at which she works. When her son is taken hostage, she is forced to rely upon her battle-hardened past and lethal skills after realizing theres no one left to save the day but her.',	'2023-05-12',	6.267,	'/lUlz0oE3zhAku7QvGoDJCeaFuiO.jpg',	'/8voINwqMlscROrjhN97fGkmhvEV.jpg',	'en',	0),
(1147400,	'Miraculous World: Paris, Tales of Shadybug and Claw Noir',	'Miraculous holders from another world appear in Paris. They come from a parallel universe where everything is reversed: the holders of Ladybug and Black Cat Miraculouses, Shadybug and Claw Noir, are the bad guys, and the holder of the Butterfly Miraculous, Hesperia, is a superhero. Ladybug and Cat Noir will have to help Hesperia counter the attacks of their evil doubles and prevent them from seizing the Butterfly s Miraculous. Can our heroes also help Hesperia make Shadybug and Claw Noir better ',	'2023-10-21',	7.624,	'/hU1Q9YVzdYhokr8a9gLywnSUMlN.jpg',	'/7Md3nuV0ZprBTnkdR3OrUCEsrSP.jpg',	'fr',	0),
(1219685,	'Un pre idal',	'',	'2024-04-21',	5.847,	'/iafs5DG5fGq7ef0acl3xlX4BFrs.jpg',	'/4xJd3uwtL1vCuZgEfEc8JXI9Uyx.jpg',	'fr',	0);
